tables.table_schema:
CREATE TABLE quantum_networking_equipment (
    equipment_id UUID PRIMARY KEY,
    device_name VARCHAR(50) NOT NULL,
    quantum_type VARCHAR(50) NOT NULL,
    configuration_settings JSONB
);

CREATE TABLE networking_configuration_settings (
    setting_id UUID PRIMARY KEY,
    equipment_id UUID REFERENCES quantum_networking_equipment(equipment_id),
    setting_name VARCHAR(50) NOT NULL,
    setting_value VARCHAR(100) NOT NULL
);

CREATE TABLE QuantumNetworkingEquipment (
   equipment_id INT PRIMARY KEY,
   equipment_name VARCHAR(50),
   configuration_settings JSON
);

CREATE TABLE NetworkOperators (
   operator_id INT PRIMARY KEY,
   operator_name VARCHAR(50),
   operator_location VARCHAR(100)
);

CREATE TABLE NetworkConnections (
   connection_id INT PRIMARY KEY,
   source_operator_id INT,
   destination_operator_id INT,
   connection_speed INT
);

CREATE TABLE quantum_networking_equipment ( 
    equipment_id INT PRIMARY KEY, 
    equipment_name VARCHAR(50), 
    manufacturer VARCHAR(50), 
    configuration_settings JSONB
);

CREATE TABLE network_operators ( 
    operator_id INT PRIMARY KEY, 
    operator_name VARCHAR(50), 
    region VARCHAR(50), 
    contact_email VARCHAR(50)
);

CREATE TABLE network_connections ( 
    connection_id INT PRIMARY KEY, 
    source_equipment_id INT, 
    destination_equipment_id INT, 
    connection_type VARCHAR(50)
);

CREATE TABLE network_errors ( 
    error_id INT PRIMARY KEY, 
    error_description TEXT, 
    connection_id INT, 
    timestamp TIMESTAMP
);
